import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";

export const Navbar = () => {
  return (
    <div>
      <header>
        <Link to="/" className="logo">
          ActiveLink.
        </Link>
        <nav>
          <Link to="/" className="active">
            Home
          </Link>
          <Link to="/">About</Link>
          <Link to="/products">Products</Link>
          <Link to="/profile">profile</Link>
          <Link to="/">Contact</Link>
        </nav>
      </header>
    </div>
  );
};
